/*Table structure for table `sponsees` */

DROP TABLE IF EXISTS `sponsees`;

CREATE TABLE `sponsees` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `firstname` varchar(100) DEFAULT NULL,
  `lastname` varchar(100) DEFAULT NULL,
  `middlename` varchar(100) DEFAULT NULL,
  `gender` varchar(20) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `country` varchar(10) DEFAULT NULL,
  `maplocation` varchar(500) DEFAULT NULL,
  `videolink` text,
  `long_description` text,
  `short_description` text,
  `birthdate` date DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=73 DEFAULT CHARSET=latin1;

/*Data for the table `sponsees` */

insert  into `sponsees`(`id`,`firstname`,`lastname`,`middlename`,`gender`,`address`,`country`,`maplocation`,`videolink`,`long_description`,`short_description`,`birthdate`) values (1,'Sam','CaÃƒÂ±ete','Villegas','Male','Santa Fe, Cebu','PH','http://wikimapia.org/#lang=en&lat=11.240705&lon=123.758583&z=12&m=b&search=bantayan%20island%2C%20cebu%20city','<iframe width=\"310\" height=\"300\" src=\"//www.youtube.com/embed/wlETQybuGQk\" frameborder=\"0\" allowfullscreen=\"\"></iframe>','Sam was born to have a cleft lip and a palate, he lives with his family consisting of his Father,mother and 1 sister in Bantayan island north of Cebu, Philippines.\r\n\r\nHis father (Anthony CaÃƒÂ±ete) works as a carpenter helper. The work of the helper is very difficult due to its instability projects and very low pay with 150-200 pesos a day only, and if there are no projects for him its very difficult for the family to eat 3 times a day. \r\n\r\nSam family lives together with his grandmother and grandfather small house, made of bamboo and local materials. Their family shares \r\nthe house with his cousins family as well with 4 adults and 5 children.','Sam was born to have a cleft lip and a palate, he lives with his family consisting of his Father,mother and 1 sister in Bantayan island north of Cebu, Philippines.','2011-11-11'),(2,'Rosalie','Rosello','D.','Female','Kinatarkan, Bantayan Island, Cebu','PH','http://wikimapia.org/26179608/Kinatarkan','<iframe width=\"310\" height=\"300\" src=\"//www.youtube.com/embed/wlETQybuGQk\" frameborder=\"0\" allowfullscreen=\"\"></iframe>','Rosalie D. Rosello, 12 years old girl born in San Miguel street, Kinatarcan, Sta.fe, Bantayan Island Cebu. Rosalie is the 4th  daughter of fisherman Rolando Almonicar Rosello and his  plain housewife Maria Fe Dabalos Rosello. Mr. Rolando, a 45 years old is a hardworking man, raised his 8 children in a very discipline way. It was from him that Rosalie learned much of her hard work and perseverance. Her mother Maria Fe actually gave birth of 10 children, but unfortunately her two kids passed away. The first one drowned in the ocean while the other one died because of pulmonary. So they are having 8 kids now including Rosalie, 4 girls and 4 boys.\r\n\r\nRosalie, is now a grade 6 student in Kinatarcan elementary School. She is always doing great in her studies that\'s why she has always been an honor student in spite of her circumstances she did not use it as an excuse or an alibi not to go to school. Though life for her is not easy compared to other students, having a cleft lip has given her much difficulties and insecurities but she still pushes forward in the face of many obstacles.\r\n\r\nThrough the Smile Train Program, Rosalie received free  sponsored cleft lip and palate surgery at the skilled hands of Dr. Mirela Mijares and her team at Cebu City Medical Hospital, the partner hospital of Smile Train in Cebu, Philippines. Under the Smile Train Program, the Cleft patient undergoes as many surgical procedures as he/she needs FOR FREE. All the medications, laboratory exams, medical supplies, hospitalization costs are shouldered by Smile Train except for the incidental expenses for the food and transportation fees, on which WE as part of the  Abounding In Love comes in to help those family who can\'t afford for the transportation, food and a place to stay in the city. Especially to those family who lives in the mountain villages and in the island like Rosalie\'s family.','Rosalie D. Rosello, 12 years old girl born in San Miguel street, Kinatarcan, Sta.fe, Bantayan Island Cebu. Rosalie is the 4th  daughter of fisherman Rolando Almonicar Rosello and his  plain housewife Maria Fe Dabalos Rosello. Mr. Rolando, a 45 years old is a hardworking man, raised his 8 children in a very discipline way. It was from him that Rosalie learned much of her hard work and perseverance. Her mother Maria Fe actually gave birth of 10 children, but unfortunately her two kids passed away. The first one drowned in the ocean while the other one died because of pulmonary. So they are having 8 kids now including Rosalie, 4 girls and 4 boys.','2002-09-19'),(69,'Zyriel','Nepangue','Deo','Female','Maricaban, Bantayan Island, Cebu','PH','http://wikimapia.org/#lang=en&lat=11.240705&lon=123.758583&z=12&m=b&search=bantayan%20island%2C%20cebu%20city','<iframe width=\"310\" height=\"300\" src=\"//www.youtube.com/embed/wlETQybuGQk\" frameborder=\"0\" allowfullscreen></iframe>','Baby Zyriel was also born to have a cleft palate on April 10, 2013. She\'s also born in the northern part of Cebu, in Bantayan Island. Her father\'s name is Ricjun Nepangue who doesn\'t have a permanent job, he sometimes worked as a carpenter\'s helper depending only on the projects. Her mother Maribeth Deo is just a plain housewife, baby Zyriel is their only child. \r\n\r\nCurrently, they are living together with her grandma\'s(father side) cousin house since they cannot afford to build their own house. Their  parents are not yet married as of now because her father  was under aged when her mother got pregnant of her.','Baby Zyriel was also born to have a cleft palate on April 10, 2013. She\'s also born in the northern part of Cebu, in Bantayan Island. Her father\'s name is Ricjun Nepangue who doesn\'t have a permanent job, he sometimes worked as a carpenter\'s helper depending only on the projects. Her mother Maribeth Deo is just a plain housewife, baby Zyriel is their only child. ','2013-04-10'),(70,'Rymar','Tendido','Bacolod','Male','Madridejos, Bantayan Island, Cebu','PH','http://wikimapia.org/#lang=en&lat=11.240705&lon=123.758583&z=12&m=b&search=bantayan%20island%2C%20cebu%20city','<iframe width=\"310\" height=\"300\" src=\"//www.youtube.com/embed/wlETQybuGQk\" frameborder=\"0\" allowfullscreen></iframe>','Rymar Tendido was born on March 5, 2012 in Maalat, Madridejos, Bantayan Island, Cebu. He\'s the eldest son in the family and was born to have a cleft lip. There are 2 children in the family, he\'s only 10 months old ahead of his little sister. \r\n\r\nHis father Henry and his mother Staryly got married in a very young age. His father works as a construction worker and his mother is only a housewife.\r\n','Rymar Tendido was born on March 5, 2012 in Maalat, Madridejos, Bantayan Island, Cebu. He\'s the eldest son in the family and was born to have a cleft lip. There are 2 children in the family, he\'s only 10 months old ahead of his little sister.','2013-03-05'),(71,'Jeramie','Layaog','Boltron','Female','Hinatas an, Hilantagaan, Bantayan Island, Cebu','PH','http://wikimapia.org/#lang=en&lat=11.240705&lon=123.758583&z=12&m=b&search=bantayan%20island%2C%20cebu%20city','<iframe width=\"310\" height=\"300\" src=\"//www.youtube.com/embed/wlETQybuGQk\" frameborder=\"0\" allowfullscreen></iframe>','Jeramie lives with her father and mother. There are 2 children in the family and she is the eldest daughter. They lives in one of the small islands in Bantayan, known as Hilantagaan Island. \r\n\r\nSince they are surrounded by the ocean, fishing is their only source of income and her mother is a pure housewife. Jeramie is now in Grade 1, she also works at home running errands. \r\n\r\nSince birth she already have a cleft lip, and now that she is already 6 years old she really wanted to undergo for an operation to have a beautiful smile like her oth','Jeramie lives with her father and mother. There are 2 children in the family and she is the eldest daughter. They lives in one of the small islands in Bantayan, known as Hilantagaan Island. ','2006-11-14'),(72,'Genise','Derder','Escaran','Female','Dakong baybay, Hilantagaan Island, Bantayan Island, Cebu','SouthKore','http://wikimapia.org/#lang=en&lat=11.240705&lon=123.758583&z=12&m=b&search=bantayan%20island%2C%20cebu%20city','<iframe width=\"310\" height=\"300\" src=\"//www.youtube.com/embed/wlETQybuGQk\" frameborder=\"0\" allowfullscreen></iframe>','Genise is just a little baby, she was recently born on May 3, 2013. At the young age she is also have a clefp lip. There are 5 children in their family and Genise is the youngest and the only one who got the cleft lip among the children. They lived in Hilantagaan, Bantayan Island, Cebu. Her father worked as a fisherman since they are surrounded of ocean, fishing is their only way of living, her mother is only a housewife. \r\n\r\nIn the young age Genise supposedly have a proper breastfeeding with her mother but because of her cleft lip her mother can\'t able to breastfeed her. Because of that their families situation is having so much difficulties they cannot sustain a proper milk for Genise, they just always bought her a pack of  adult milk everyday just to feed her because they cannot afford to buy a proper milk for babies which cost almost 500 pesos for 1 can.','Genise is just a little baby, she was recently born on May 3, 2013. At the young age she is also have a clefp lip. There are 5 children in their family and Genise is the youngest and the only one who got the cleft lip among the children. ','2013-03-03');

/*Table structure for table `users` */

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `username` varchar(50) DEFAULT NULL,
  `password` varchar(50) DEFAULT NULL,
  `email` varchar(100) DEFAULT NULL,
  `role` varchar(20) DEFAULT NULL,
  `created` datetime DEFAULT NULL,
  `modified` datetime DEFAULT NULL,
  `firstname` varchar(100) DEFAULT NULL,
  `lastname` varchar(100) DEFAULT NULL,
  `middlename` varchar(100) DEFAULT NULL,
  `address` varchar(100) DEFAULT NULL,
  `country` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uix_user_username` (`username`),
  UNIQUE KEY `uix_user_email` (`email`)
